import React, { Component } from 'react'

export default class BalanceSheet extends Component {
    render() {
        const annualReport = this.props.data.data.annualReports[0];
        
        var items = [];
        Object.keys(annualReport).forEach( function(key) {
            items.push(annualReport[key]); 
        })
        
        console.log(items)

        return items.map((item) => (
            <div>
                <p>{item.label} : {item}</p>
            </div>
        ));
    }
}
